window.bookSummaryJSON = "<p>Spell in haste, repent at leisure....</p> <p>Middle-aged witch Quinn Callahan agrees to hold a book launch for the best-selling but recently dead author Bartholomew Branson. It's a small favor for the new vampire. Unfortunately, things get out of hand when the author arranges a huge launch party and someone dies.&nbsp;&nbsp;</p> <p>Spells are going wrong, the book contains a dreadful mistake, and the town of Ballydehag, Ireland is once again in turmoil.&nbsp;</p> <p>This is the third novel in the Vampire Book Club series of paranormal women's fiction cozy mysteries from a <i>USA Today</i> best-selling author.&nbsp;</p> <p><i>A Spelling Mistake</i> is book three in the Vampire Book Club series of cozy paranormal mysteries. Each can be listened to alone and there is no bad language or gore. There is humor, murder solving and a touch of romance from the best-selling author of the Vampire Knitting Club series.</p>"; 
